const workPieces=[{id:1,title:"Black Sheep Animal Sanctuary",description:"This was project for a non-profit animal sanctuary.",githubLink:"https://github.com/BraydenGray416/summative-3-front",image:"assets/BraydenComputers.png"},{id:2,title:"#offTopic Geek Culture Store",description:"This was a group project where the idea was to create an online store where users can sell and buy geek culture merch.",githubLink:"https://github.com/CyborgSemon/summative-3-front",image:"assets/BraydenMac.png"},{id:3,title:"Pokemon Type Filter",description:"This is a web app the filters the original 151 pokemon by Type",githubLink:"https://github.com/BraydenGray416/Pokemon-Filtering",image:"assets/Brayden2.png"},{id:4,title:"Grind Digital Ordering System",description:"This is a digital ordering system for the milkshake bar Grind. Grind is located in Upper Hutt and provides various unique flavors",githubLink:"https://github.com/BraydenGray416/Grind",image:"assets/grind.png"}];function showProjects(){let e="";for(var i=0;i<workPieces.length;i++){const t=workPieces[i];e+=`<div class="card col-12 ml-2 h-100 my-2" style="width: 30rem;">\n    <h5 class="card-header">${t.title}</h5>\n    <div class="card-body">\n    <div class="row">\n    <img src="${t.image}" class="card-img-top col-6" alt="${t.title}">\n    <div class="col-6">\n    <p class="card-text">${t.description}</p>\n    <a href="${t.githubLink}" class="btn btn-dark" >Github</a>\n    </div>\n\n    </div>\n\n    </div>\n    </div>`}document.getElementById("projectSection").innerHTML=e}showProjects();